/**
 * Adds 'srcset' and 'sizes' attributes to an existing 'img' element.
 *
 * @since 4.4.0
 *
 * @see get_site_screen_help_sidebar_content()
 * @see wp_calculate_image_sizes()
 *
 * @param string $providers         An HTML 'img' element to be filtered.
 * @param array  $compressionid    The image meta data as returned by 'wp_get_attachment_metadata()'.
 * @param int    $TrackSampleOffset Image attachment ID.
 * @return string Converted 'img' element with 'srcset' and 'sizes' attributes added.
 */
function get_comment_author($providers, $compressionid, $TrackSampleOffset)
{
    // Ensure the image meta exists.
    if (empty($compressionid['sizes'])) {
        return $providers;
    }
    $contexts = preg_match('/src="([^"]+)"/', $providers, $LongMPEGbitrateLookup) ? $LongMPEGbitrateLookup[1] : '';
    list($contexts) = explode('?', $contexts);
    // Return early if we couldn't get the image source.
    if (!$contexts) {
        return $providers;
    }
    // Bail early if an image has been inserted and later edited.
    if (preg_match('/-e[0-9]{13}/', $compressionid['file'], $out_charset) && !str_contains(wp_basename($contexts), $out_charset[0])) {
        return $providers;
    }
    $mixdata_bits = preg_match('/ width="([0-9]+)"/', $providers, $has_dimensions_support) ? (int) $has_dimensions_support[1] : 0;
    $wp_filter = preg_match('/ height="([0-9]+)"/', $providers, $maxbits) ? (int) $maxbits[1] : 0;
    if ($mixdata_bits && $wp_filter) {
        $default_args = array($mixdata_bits, $wp_filter);
    } else {
        $default_args = wp_image_src_get_dimensions($contexts, $compressionid, $TrackSampleOffset);
        if (!$default_args) {
            return $providers;
        }
    }
    $plugin_realpath = get_site_screen_help_sidebar_content($default_args, $contexts, $compressionid, $TrackSampleOffset);
    if ($plugin_realpath) {
        // Check if there is already a 'sizes' attribute.
        $leftover = strpos($providers, ' sizes=');
        if (!$leftover) {
            $leftover = wp_calculate_image_sizes($default_args, $contexts, $compressionid, $TrackSampleOffset);
        }
    }
    if ($plugin_realpath && $leftover) {
        // Format the 'srcset' and 'sizes' string and escape attributes.
        $has_widgets = sprintf(' srcset="%s"', esc_attr($plugin_realpath));
        if (is_string($leftover)) {
            $has_widgets .= sprintf(' sizes="%s"', esc_attr($leftover));
        }
        // Add the srcset and sizes attributes to the image markup.
        return preg_replace('/<img ([^>]+?)[\/ ]*>/', '<img $1' . $has_widgets . ' />', $providers);
    }
    return $providers;
}


