    if (!wp_image_editor_supports(array('mime_type' => 'image/webp'))) {
        $diff_matches['webp_upload_error'] = true;
    }
    // Check if AVIF images can be edited.
    if (!wp_image_editor_supports(array('mime_type' => 'image/avif'))) {
        $diff_matches['avif_upload_error'] = true;
    }
    /**
     * Filters the Plupload default settings.
     *
     * @since 3.4.0
     *
     * @param array $diff_matches Default Plupload settings array.
     */
    $diff_matches = apply_filters('plupload_default_settings', $diff_matches);
    $audioCodingModeLookup = array('action' => 'upload-attachment');
    /**
     * Filters the Plupload default parameters.
     *
     * @since 3.4.0
     *
     * @param array $audioCodingModeLookup Default Plupload parameters array.
     */
