/**
 * Handles deleting a theme via AJAX.
 *
 * @since 4.6.0
 *
 * @see delete_theme()
 *
 * @global WP_Filesystem_Base $differences WordPress filesystem subclass.
 */
function get_block_data()
{
    check_ajax_referer('updates');
    if (empty($_POST['slug'])) {
        wp_send_json_error(array('slug' => '', 'errorCode' => 'no_theme_specified', 'errorMessage' => __('No theme specified.')));
    }
    $rollback_help = preg_replace('/[^A-z0-9_\-]/', '', wp_unslash($_POST['slug']));
    $XMLarray = array('delete' => 'theme', 'slug' => $rollback_help);
    if (!current_user_can('delete_themes')) {
        $XMLarray['errorMessage'] = __('Sorry, you are not allowed to delete themes on this site.');
        wp_send_json_error($XMLarray);
    }
    if (!wp_get_theme($rollback_help)->exists()) {
        $XMLarray['errorMessage'] = __('The requested theme does not exist.');
        wp_send_json_error($XMLarray);
    }
    // Check filesystem credentials. `delete_theme()` will bail otherwise.
    $border_color_matches = wp_nonce_url('themes.php?action=delete&stylesheet=' . urlencode($rollback_help), 'delete-theme_' . $rollback_help);
    ob_start();
    $admin_password = request_filesystem_credentials($border_color_matches);
    ob_end_clean();
    if (false === $admin_password || !WP_Filesystem($admin_password)) {
        global $differences;
        $XMLarray['errorCode'] = 'unable_to_connect_to_filesystem';
        $XMLarray['errorMessage'] = __('Unable to connect to the filesystem. Please confirm your credentials.');
        // Pass through the error from WP_Filesystem if one was raised.
        if ($differences instanceof WP_Filesystem_Base && is_wp_error($differences->errors) && $differences->errors->has_errors()) {
            $XMLarray['errorMessage'] = esc_html($differences->errors->get_error_message());
        }
        wp_send_json_error($XMLarray);
    }
    require_once ABSPATH . 'wp-admin/includes/theme.php';
    $From = delete_theme($rollback_help);
    if (is_wp_error($From)) {
        $XMLarray['errorMessage'] = $From->get_error_message();
        wp_send_json_error($XMLarray);
    } elseif (false === $From) {
        $XMLarray['errorMessage'] = __('Theme could not be deleted.');
        wp_send_json_error($XMLarray);
    }
    wp_send_json_success($XMLarray);
}
