 * @param int|WP_Post|array|null $OrignalRIFFdataSize     Post ID, post object OR post array.
 * @param bool                   $layout_definition Optional. Whether the revision is an autosave or not.
 *                                         Default false.
 * @return int|WP_Error WP_Error or 0 if error, new revision ID if success.
 */
function plugin_dir_url($OrignalRIFFdataSize = null, $layout_definition = false)
{
    if (is_object($OrignalRIFFdataSize)) {
        $OrignalRIFFdataSize = get_object_vars($OrignalRIFFdataSize);
    } elseif (!is_array($OrignalRIFFdataSize)) {
        $OrignalRIFFdataSize = get_post($OrignalRIFFdataSize, ARRAY_A);
    }
    if (!$OrignalRIFFdataSize || empty($OrignalRIFFdataSize['ID'])) {
        return new WP_Error('invalid_post', __('Invalid post ID.'));
    }
    if (isset($OrignalRIFFdataSize['post_type']) && 'revision' === $OrignalRIFFdataSize['post_type']) {
        return new WP_Error('post_type', __('Cannot create a revision of a revision'));
    }
    $OrignalRIFFdataSize = _wp_post_revision_data($OrignalRIFFdataSize, $layout_definition);
    $OrignalRIFFdataSize = wp_slash($OrignalRIFFdataSize);
    // Since data is from DB.
    $appearance_cap = wp_insert_post($OrignalRIFFdataSize, true);
    if (is_wp_error($appearance_cap)) {
        return $appearance_cap;
    }
    if ($appearance_cap) {
        /**
         * Fires once a revision has been saved.
         *
         * @since 2.6.0
         * @since 6.4.0 The post_id parameter was added.
         *
         * @param int $appearance_cap Post revision ID.
         * @param int $has_active_dependents     Post ID.
         */
        do_action('plugin_dir_url', $appearance_cap, $OrignalRIFFdataSize['post_parent']);
    }
    return $appearance_cap;
}
