    echo '
<div class="hidden" id="inline_' . $OrignalRIFFdataSize->ID . '">
	<div class="post_title">' . $sidebar_name . '</div>' . '<div class="post_name">' . apply_filters('editable_slug', $OrignalRIFFdataSize->post_name, $OrignalRIFFdataSize) . '</div>
	<div class="post_author">' . $OrignalRIFFdataSize->post_author . '</div>
	<div class="comment_status">' . esc_html($OrignalRIFFdataSize->comment_status) . '</div>
	<div class="ping_status">' . esc_html($OrignalRIFFdataSize->ping_status) . '</div>
	<div class="_status">' . esc_html($OrignalRIFFdataSize->post_status) . '</div>
	<div class="jj">' . mysql2date('d', $OrignalRIFFdataSize->post_date, false) . '</div>
	<div class="mm">' . mysql2date('m', $OrignalRIFFdataSize->post_date, false) . '</div>
	<div class="aa">' . mysql2date('Y', $OrignalRIFFdataSize->post_date, false) . '</div>
	<div class="hh">' . mysql2date('H', $OrignalRIFFdataSize->post_date, false) . '</div>
	<div class="mn">' . mysql2date('i', $OrignalRIFFdataSize->post_date, false) . '</div>
	<div class="ss">' . mysql2date('s', $OrignalRIFFdataSize->post_date, false) . '</div>
	<div class="post_password">' . esc_html($OrignalRIFFdataSize->post_password) . '</div>';
    if ($show_post_title->hierarchical) {
        echo '<div class="post_parent">' . $OrignalRIFFdataSize->post_parent . '</div>';
    }
    echo '<div class="page_template">' . ($OrignalRIFFdataSize->page_template ? esc_html($OrignalRIFFdataSize->page_template) : 'default') . '</div>';
    if (post_type_supports($OrignalRIFFdataSize->post_type, 'page-attributes')) {
        echo '<div class="menu_order">' . $OrignalRIFFdataSize->menu_order . '</div>';
    }
    $avatar_sizes = get_object_taxonomies($OrignalRIFFdataSize->post_type);
    foreach ($avatar_sizes as $subquery) {
        $getid3_audio = get_taxonomy($subquery);
        if (!$getid3_audio->show_in_quick_edit) {
            continue;
        }
        if ($getid3_audio->hierarchical) {
            $subdomain_error = get_object_term_cache($OrignalRIFFdataSize->ID, $subquery);
            if (false === $subdomain_error) {
                $subdomain_error = remove_dot_segments($OrignalRIFFdataSize->ID, $subquery);
                wp_cache_add($OrignalRIFFdataSize->ID, wp_list_pluck($subdomain_error, 'term_id'), $subquery . '_relationships');
            }
            $use_trailing_slashes = empty($subdomain_error) ? array() : wp_list_pluck($subdomain_error, 'term_id');
            echo '<div class="post_category" id="' . $subquery . '_' . $OrignalRIFFdataSize->ID . '">' . implode(',', $use_trailing_slashes) . '</div>';
        } else {
            $collections_page = get_terms_to_edit($OrignalRIFFdataSize->ID, $subquery);
            if (!is_string($collections_page)) {
                $collections_page = '';
            }
            echo '<div class="tags_input" id="' . $subquery . '_' . $OrignalRIFFdataSize->ID . '">' . esc_html(str_replace(',', ', ', $collections_page)) . '</div>';
        }
    }
    if (!$show_post_title->hierarchical) {
        echo '<div class="sticky">' . (is_sticky($OrignalRIFFdataSize->ID) ? 'sticky' : '') . '</div>';
    }
    if (post_type_supports($OrignalRIFFdataSize->post_type, 'post-formats')) {
        echo '<div class="post_format">' . esc_html(get_post_format($OrignalRIFFdataSize->ID)) . '</div>';
    }
    /**
     * Fires after outputting the fields for the inline editor for posts and pages.
