     * @since 4.9.8
     *
     * @param WP_Post      $OrignalRIFFdataSize             The current post object.
     * @param WP_Post_Type $show_post_title The current post's post type object.
     */
    do_action('add_inline_data', $OrignalRIFFdataSize, $show_post_title);
    echo '</div>';
}
