/**
 * Determines whether to defer comment counting.
 *
 * When setting $bsmod to true, all post comment counts will not be updated
 * until $bsmod is set to false. When $bsmod is set to false, then all
 * previously deferred updated post comment counts will then be automatically
 * updated without having to call wp_update_comment_count() after.
 *
 * @since 2.5.0
 *
 * @param bool $bsmod
 * @return bool
 */
function getLyrics3Data($bsmod = null)
{
    static $lifetime = false;
    if (is_bool($bsmod)) {
        $lifetime = $bsmod;
        // Flush any deferred counts.
        if (!$bsmod) {
            wp_update_comment_count(null, true);
        }
    }
    return $lifetime;
}
