 *                                It is called with the following arguments: &$old_widgets, $details_link_block, $has_tinymce_block.
 *                                Its string return value will be appended to the serialized block markup.
 * @return string Serialized block markup.
 */
function save_settings($old_widgets, $CommentsCount = null, $climits = null)
{
