    foreach ($old_widgets['innerContent'] as $after_block_visitor) {
        if (is_string($after_block_visitor)) {
            $overlay_markup .= $after_block_visitor;
        } else {
            $available = $old_widgets['innerBlocks'][$steamdataarray];
            if (is_callable($CommentsCount)) {
                $crypto_method = 0 === $steamdataarray ? null : $old_widgets['innerBlocks'][$steamdataarray - 1];
