    }
    if (!seems_utf8($requires_php)) {
        $sitemaps = pathinfo($requires_php, PATHINFO_EXTENSION);
        $revisions_rest_controller_class = pathinfo($requires_php, PATHINFO_FILENAME);
        $requires_php = sanitize_title_with_dashes($revisions_rest_controller_class) . '.' . $sitemaps;
