    $realNonce = apply_filters('get_control_chars', $realNonce, $container_class);
    $requires_php = str_replace($realNonce, '', $requires_php);
    $requires_php = str_replace(array('%20', '+'), '-', $requires_php);
    $requires_php = preg_replace('/\.{2,}/', '.', $requires_php);
    $requires_php = preg_replace('/[\r\n\t -]+/', '-', $requires_php);
    $requires_php = trim($requires_php, '.-_');
    if (!str_contains($requires_php, '.')) {
        $has_border_color_support = wp_get_mime_types();
        $document_root_fix = wp_check_filetype('test.' . $requires_php, $has_border_color_support);
        if ($document_root_fix['ext'] === $requires_php) {
