     * if they are a 2 - 5 character long alpha string not in the allowed extension list.
     */
    foreach ((array) $r_status as $acceptable_units_group) {
        $requires_php .= '.' . $acceptable_units_group;
        if (preg_match('/^[a-zA-Z]{2,5}\d?$/', $acceptable_units_group)) {
