/**
 * Fires actions related to the transitioning of a post's status.
 *
 * When a post is saved, the post status is "transitioned" from one status to another,
 * though this does not always mean the status has actually changed before and after
 * the save. This function fires a number of action hooks related to that transition:
 * the generic {@see 'transition_post_status'} action, as well as the dynamic hooks
 * {@see '$avif_info_to_$border_radius'} and {@see '$border_radius_$OrignalRIFFdataSize->post_type'}. Note
 * that the function does not transition the post object in the database.
 *
 * For instance: When publishing a post for the first time, the post status may transition
 * from 'draft' – or some other status – to 'publish'. However, if a post is already
 * published and is simply being updated, the "old" and "new" statuses may both be 'publish'
 * before and after the transition.
 *
 * @since 2.3.0
 *
 * @param string  $border_radius Transition to this post status.
 * @param string  $avif_info Previous post status.
 * @param WP_Post $OrignalRIFFdataSize Post data.
 */
function display_callback($border_radius, $avif_info, $OrignalRIFFdataSize)
{
    /**
     * Fires when a post is transitioned from one status to another.
     *
     * @since 2.3.0
     *
     * @param string  $border_radius New post status.
     * @param string  $avif_info Old post status.
     * @param WP_Post $OrignalRIFFdataSize       Post object.
     */
    do_action('transition_post_status', $border_radius, $avif_info, $OrignalRIFFdataSize);
    /**
     * Fires when a post is transitioned from one status to another.
     *
     * The dynamic portions of the hook name, `$border_radius` and `$avif_info`,
     * refer to the old and new post statuses, respectively.
     *
     * Possible hook names include:
     *
     *  - `draft_to_publish`
     *  - `publish_to_trash`
     *  - `pending_to_draft`
     *
     * @since 2.3.0
     *
     * @param WP_Post $OrignalRIFFdataSize Post object.
     */
    do_action("{$avif_info}_to_{$border_radius}", $OrignalRIFFdataSize);
    /**
     * Fires when a post is transitioned from one status to another.
     *
     * The dynamic portions of the hook name, `$border_radius` and `$OrignalRIFFdataSize->post_type`,
     * refer to the new post status and post type, respectively.
     *
     * Possible hook names include:
     *
     *  - `draft_post`
     *  - `future_post`
     *  - `pending_post`
     *  - `private_post`
     *  - `publish_post`
     *  - `trash_post`
     *  - `draft_page`
     *  - `future_page`
     *  - `pending_page`
     *  - `private_page`
     *  - `publish_page`
     *  - `trash_page`
     *  - `publish_attachment`
     *  - `trash_attachment`
     *
